import React, { useEffect, useState } from "react";
import "./UserDashboard.css";

const UserDashboard = () => {
  const [requests, setRequests] = useState([]);
  const [showEssentialKit, setShowEssentialKit] = useState(false);
  const userId = localStorage.getItem("userId");

  useEffect(() => {
    if (!userId) return;

    const fetchRequests = async () => {
      try {
        const res = await fetch(`http://localhost:5000/api/adoption-requests/user/${userId}`);
        const data = await res.json();
        setRequests(data);
      } catch (err) {
        console.error("Error fetching requests:", err);
      }
    };

    fetchRequests();
    const interval = setInterval(fetchRequests, 5000);
    return () => clearInterval(interval);
  }, [userId]);

  const essentialKitList = (
    <div className="essential-kit">
      <h3>üêæ Pet Essential Kit</h3>
      <ul>
        <li>Food & Water Bowls</li>
        <li>High-Quality Pet Food</li>
        <li>Leash & Collar (Dogs) / Scratching Post (Cats)</li>
        <li>Comfortable Bed</li>
        <li>Chew Toys & Interactive Toys</li>
        <li>Grooming Kit</li>
        <li>Poop Bags & Waste Scooper / Litter Box & Litter</li>
        <li>Training Pads</li>
        <li>First Aid Kit</li>
        <li>Crate or Carrier</li>
      </ul>
    </div>
  );

  return (
    <div className="user-dashboard">
      <h2>Your Adoption Requests</h2>
      {requests.length === 0 ? (
        <p>No requests yet.</p>
      ) : (
        <div className="requests-list">
          {requests.map((req) => (
            <div className="request-item" key={req._id}>
              <img
                src={req.petImage || "/images/pets/default.jpeg"}
                className="request-pet-image"
                alt="Pet"
              />
              <div>
                <h3>{req.petName}</h3>
                <p><strong>Reason:</strong> {req.reason}</p>
                <p>
                  <strong>Status:</strong>{" "}
                  <span className={`status ${req.status}`}>{req.status}</span>
                </p>
                {req.status === "approved" && (
                  <p className="success-message">üéâ Congratulations! Your adoption request has been approved.</p>
                )}
                {req.status === "rejected" && (
                  <p className="error-message">‚ùå Unfortunately, your request was not approved.</p>
                )}
                {req.status === "approved" && (
                  <div className="action-buttons">
                    <button className="btn" onClick={() => setShowEssentialKit(!showEssentialKit)}>
                      Pet Essential Kit
                    </button>
                    <button className="btn">Pet Pickup Details</button>
                  </div>
                )}
                {showEssentialKit && essentialKitList}
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default UserDashboard;
